import { Link } from 'react-router-dom';
export default function Contact() {
    return (
        <div>
            <h2>Contact Page</h2>
            <Link to="Company">Company</Link>
            <Link>Channel</Link>
            <Link>Others</Link>
        </div>
    )
}
